    <div className="modal">
      <div className="modal-content">
        <span className="close-button" onClick={onClose}>
          X
        </span>
        <div className="modal-graph">
        <p>"{nname}" Graph Name and Function will be provided by Narain Sir</p>
        {modelContentMap[name]}
        </div>
      </div>
    </div>
  );
};

export default Modal;
